import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export class Blog extends Component {
  render() {
    const blog = this.props.blog;
    return <div>
      <Link to={ `/show-blog/${blog}`}></Link>
    </div>;
  }
}

export default Blog;
